                    setDocumentoContrato(response.data.documentoContrato);
                    setDocumentoInscripcionDGI(response.data.documentoInscripcionDGI);
                    setDocumentoInscripcionBPS(response.data.documentoInscripcionBPS);
                    setDocumentoCertificadoDGI(response.data.documentoCertificadoDGI);
                    setDocumentoCertificadoBPS(response.data.documentoCertificadoBPS);
                    setDocumentoSeguroAccidentesTrabajo(response.data.documentoSeguroAccidentesTrabajo);
                    setDocumentoPlanillaTrabajo(response.data.documentoPlanillaTrabajo);
                    setFechaVencimientoCertificadoDGI(response.data.fechaVencimientoCertificadoDGI);
                    setFechaVencimientoCertificadoBPS(response.data.fechaVencimientoCertificadoBPS);
                    setFechaVencimientoSeguroAccidentesTrabajo(response.data.fechaVencimientoSeguroAccidentesTrabajo);
                    setFechaEmisionPlanillaTrabajo(response.data.fechaEmisionPlanillaTrabajo);
                }
             catch (error) {
